// src/data/services.js
import { FiDroplet, FiLayout, FiTool } from 'react-icons/fi';

export const services = [
  {
    id: 1,
    Icon: FiLayout,
    title: "Pool Design",
    description: "Custom designs tailored to your space",
    gradient: "linear-gradient(135deg, #E0F7FA, #B2EBF2, #80DEEA)"
  },
  {
    id: 2,
    Icon: FiTool,
    title: "Installation", 
    description: "Professional setup with premium materials",
    gradient: "linear-gradient(135deg, #E1F5FE, #B3E5FC, #81D4FA)"
  },
  {
    id: 3,
    Icon: FiDroplet,
    title: "Maintenance",
    description: "Regular cleaning and system checks",
    gradient: "linear-gradient(135deg, #E0F7FA, #80DEEA, #4DD0E1)",
    waterEffect: true
  }
];
